import React, { useEffect, useState } from 'react';

import './Home.css'

const Home = () => {
    const [services, setServices] = useState([]);
    useEffect(() => {
        fetch('services.json')
            .then(res => res.json())
            .then(data => setServices(data))
    }, [])
    return (
        <>
            <div className="welcome-section" id="home">

            </div>

            {/* our services section  */}
            <div className="services">
                <h1>Our Services</h1>
            </div>

        </>
    );
};
export default Home;
